export interface LowcodeOptions {
  builtinAssets?: Array<string|Assets>; // 
  extraAssets?: Array<string|Assets>; // 
  noParse?: boolean; //  lowcode meta
  categories?: string[]; // 
  groups?: string[]; //  tab 
  baseLibrary?: 'react'|'rax';
  setterMap?: SetterMap; //  setter
}

export interface SetterMap {
  [SetterName: string]: string;
}

export type Assets = {
  package: string;
  version: string;
  urls: string[];
  library: string;
};
